output: [['a', 'a', 'a', 'a', 'a'], ['a', 'a', 'a', 'a', 'a'], ['a', 'a', 'a', 'a', 'a'], ['a', 'a', 'a', 'j', 'a'], ['i', 'a', 'a', 'j', 'e']]

Test case:
input: [['a', 'd', 'a', 'g'], ['a', 'd', 'a', 'a'], ['f', 'd', 'a', 'a'], ['a', 'a', 'h', 'a']]

###########################################################
Sample Outputs:
output: [['a', 'a', 'a', 'a'], ['a', 'd', 'a', 'a'], ['a', 'd', 'a', 'a'], ['f', 'd', 'a', 'a'], ['a', 'a', 'h', 'a']]
*/

public class Solution {
    public String[][] merge(String[][] intervals) {
        if (intervals == null || intervals.length <= 0) return new String[0][];
        List<String[]> res = new ArrayList<>();
        Arrays.sort(intervals, new Comparator<String[]>() {
            @Override
            public int compare(String[] a, String[] b) {
                return Integer.compare(Integer.parseInt(a[0]), Integer.parseInt(b[0]));
            }
        });
        for (int i = 0; i < intervals.length; i++) {
            String[] cur = intervals[i];
            if (res.size() == 0 ||!cur[0].equals(res.get(res.size() - 1)[0])) {
                res.add(cur);
            } else {
                String[] last = res.get(res.size() - 1);
                last[1] = Math.max(last[1], cur[1]);
            }
        }
        return res.toArray(new String[res.size()][]);
    }
}
